const frogsData  = require('../data/frogs.json');
let frogs = [];

for(let f in frogsData){
    var img = () => require(frogsData[f]['image'])
    let frogCleanse = {
        'id': frogsData[f]['id'],
        'name': frogsData[f]['name'],
        "image": img
    }
    frogs.push(frogCleanse);
}
console.log(frogs);
export default frogs;
